import React from "react";
import { Link, Redirect } from "react-router-dom";
import "./Inicio.css";
import Homebtiinit from "../../assets/btinicio.png";

const App = (props) => {
  const checkoutHandler = () => {
    fetch("http://localhost:4000/api/config/session")
      .then((res) => res.json)
      .then((data) => {
        console.log(data);
      });
  };
  checkoutHandler();

  return (
    <div className="App">
      <h1>
        Peça já <br /> sua Pizza!
      </h1>

      <Link
        className="initbtbg"
        to={checkoutHandler() == 0 ? "/select" : "/preferential"}
      >
        <img src={Homebtiinit} className="App-btn-strart" alt="logo" />
      </Link>

      <p className="IniciarP">Toque Para Iniciar</p>
    </div>
  );
};

export default App;
